import React, { useContext } from 'react'
import './App.css';
import InputValue from '../src/component/inputValue';
import History from '../src/component/history';
import Bar from './component/Bar'
import { DataContext } from './Contexts/dataContext'
import { DataProvider } from './Contexts/dataContext'


function App() {
  const [isWeightHeight, setWeightHeight] = useContext(DataContext)
  return (

    <div className="App">
      <DataProvider>
        <h1>BMI Tracker</h1>
        <InputValue />
        <Bar labelData={isWeightHeight.date} bmiData={isWeightHeight.bmi} />
        <h2>History</h2>
        <History />
      </DataProvider>
    </div>

  );
}

export default App;
